import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import logo from "../../images/logo.svg"
import icon__main from "../../images/icon-main.svg"
import styles from "./Header.module.css";


const Header = ({ userEmail, onSignOut }) => {
    return (
        <header className={styles["header"]}>

          <Routes>
            <Route
              path="/"
              element={
                <><img className={styles["header__logo"]} src={logo} alt="Лого" />
                    <span className={styles["header-content"]}>
                    {/* <span className={styles["header-email"]}>{userEmail}</span> */}
                    <div>
                    <span
                          to="/movies"
                          className={styles["header-link"]}
                          onClick={onSignOut}
                      >
                          Фильмы
                      </span>
                      <span
                          to="/saved-movies"
                          className={styles["header-link"]}
                          onClick={onSignOut}
                      >
                          Сохраненные фильмы
                      </span>
                    </div>
                    <div>

                    </div>
                      <span
                          to="/profile"
                          className={styles["header-link"]}
                          onClick={onSignOut}
                      >
                          Аккаунт
                      </span>
                      <img className={styles["icon__main"]} src={icon__main} alt="Лого" />

                  </span></>
              }
            ></Route>

            <Route
              path="/sign-in"
              element={
                <Link to="/sign-up" className={styles["header-link"]}>
                  зарегестрироваться
                </Link>
              }
            />
            <Route
              path="/sign-up"
              element={
                <Link to="/sign-in" className={styles["header-link"]}>
                  войти
                </Link>
              }
            />
          </Routes>
        </header>
      );
    }

    export default Header;
